import React, { useEffect, useState } from 'react'
import { useNavigate, useParams }  from "react-router-dom";
import FormAdmin from '../components/FormAdmin';
export default function Adminform() {
  let { id } = useParams();
  const navigate = useNavigate();
  const [state, setState]= useState({
    userid:null,
    role:null,
    profileimage:null,
    lastname:null,
    firstname:null,
    email:null,
    phone:null,
    gender:null,
    birthdate:null,
    passport:[],
    address:[]
  });
  useEffect(() => {
    //setState({...state, loading:true});
    if(id){
      //axios.get('books/'+id)
      //.then((result) => setState({...result.data.data,error:null,loading:false}))
      //.catch((err) => setState({error: err.response.data.error.message, loading:false}));
      setState({userid:id,role:'admin',profileimage:1,lastname:'TS',firstname:'BASMAA',email:'tengertravel39@gmail.com',phone:'95953939',gender:'Female',birthdate:'1988-09-12',passport:['e','8754213','2032-12-01'],address:['Улаанбаатар','Хан-Уул','8-р хороо','14-35 тоот']});
    }
  },[]);
  return (
    <div class="content-wrapper">
      <div className="content-header">
        <div className="container-fluid">
          <div className="row mb-2">
            <div className="col-sm-5">
              <h1 className="m-0">Админ хэрэглэгч нэмэх</h1>
            </div>{/* /.col */}
            <div className="col-sm-2">
            <button type="button" class="btn btn-block btn-primary btn-sm" onClick={()=>navigate("../admin")}>Буцах{state.id}</button>
            </div>
          </div>{/* /.row */}
        </div>{/* /.container-fluid */}
      </div> 
      <div className="content">
        <div className="container-fluid">
          <div className="row">
            <FormAdmin adminstate={state}/>
          </div>
        </div>
      </div>
    </div>
  )
}
